import { AppBar, Toolbar, makeStyles } from '@material-ui/core';
import { NavLink } from 'react-router-dom';
import StockMarket from '../Assets/Images/StockMarket.jpg';

const useStyle = makeStyles({
    header: {
        background: '#111111'

    },
    tabs: {
        color: '#FFFFFF',
        marginRight: 20,
        textDecoration: 'none',
        fontSize: 20
    },
    paperContainer: {
            backgroundImage: `url(${StockMarket})`
        }
})

const NavBar = () => {
    const classes = useStyle();
    return (
        <AppBar position="static" className={classes.paperContainer}>
            <Toolbar>
                <NavLink className={classes.tabs} to="/" exact>Home</NavLink>
                <NavLink className={classes.tabs} to="/stockslist" exact>StocksList</NavLink>
                <NavLink className={classes.tabs} to="/add" exact>Add Stock</NavLink>
            </Toolbar>
        </AppBar>
    )
}

export default NavBar;
